/**
 * GPW - Generate pronounceable passwords
 * This program uses statistics on the frequency of three-letter sequences
 * in English to generate passwords.  The statistics are
 * generated from your dictionary by the program load_trigram.
 *
 * See www.multicians.org/thvv/gpw.html for history and info.
 * Tom Van Vleck
 *
 * THVV 06/01/94 Coded
 * THVV 04/14/96 converted to Java
 * THVV 07/30/97 fixed for Netscape 4.0
 * THVV 11/27/09 ported to Javascript
 *
 * Leonard Hecker 05/17/15 ported to node.js
 */
import * as crypto from "crypto";

export default function gpw(length: number) {
    let output = "";

    // Pick a random starting point.
    const pik = rand(); // random number [0,1)
    const ranno = pik * 125729.0;
    let sum = 0;

    startLoop:
        for (let c1 = 0; c1 < 26; c1++) {
            for (let c2 = 0; c2 < 26; c2++) {
                for (let c3 = 0; c3 < 26; c3++) {
                    sum += trigram[c1][c2][c3];

                    if (sum > ranno) {
                        output += alphabet[c1];
                        output += alphabet[c2];
                        output += alphabet[c3];

                        // Found start. Break all 3 loops.
                        break startLoop;
                    }
                }
            }
        }

    // Now do a random walk.
    let nchar = 3;

    while (nchar < length) {
        const c1 = inverseAlphabet[output[nchar - 2]];
        const c2 = inverseAlphabet[output[nchar - 1]];

        sum = 0;
        for (let c3 = 0; c3 < 26; c3++) {
            sum += trigram[c1][c2][c3];
        }
        if (sum === 0) {
            break; // exit while loop
        }

        const pik = rand();
        const ranno = pik * sum;

        sum = 0;
        for (let c3 = 0; c3 < 26; c3++) {
            sum += trigram[c1][c2][c3];
            if (sum > ranno) {
                output += alphabet[c3];
                break;
            }
        }

        nchar++;
    }

    return output;
};

function rand() {
    // IEEE 754 double precision numbers are computed as:
    //   -1^sign * 2^(exponent-1023) * 1.fraction
    // The following code sets:
    //   * sign bit to 0
    //   * the exponent to 0x3ff, which equals 1023
    // and thus causes the formula to equal:
    //   1.fraction
    // After subtracting 1 from the result we get a random number within [0,1).
    const buf = crypto.randomBytes(8);
    buf[7] = 0x3f;
    buf[6] |= 0xf0;
    return buf.readDoubleLE(0) - 1;
}

function inverseArray(array: string[]): { [key: string]: number } {
    const map: { [key: string]: number } = {};

    for (let i = 0; i < array.length; i++) {
        map[array[i]] = i;
    }

    return map;
}

